import React from 'react';
import './Footer.css';
import { Button } from './Button';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <div className='footer-container' id="footer">
      <section className='footer-subscription'>
        <p className='footer-subscription-heading'>
        Have a question? Send us a message!</p>
        <div className='input-areas'>
          <form>
          <input
              className='footer-input'
              name='name'
              type='text'
              placeholder='Your Name'
            />
            <input
              className='footer-input'
              name='email'
              type='email'
              placeholder='Your Email'
            />
            <input
              className='footer-input'
              name='subject'
              type='text'
              placeholder='Your Subject'
            />
            <textarea className='footer-input' name="Message" rows="7" placeholder=' Your Message' required/>
            <Button buttonStyle='btn--outline'>Send Message &nbsp;<i class="fa fa-arrow-right"></i></Button>
          </form>
        </div>
      </section>
      <section class='social-media'>
        <div class='social-media-wrap'>
          <div class='social-icons'>
            <Link
              class='social-icon-link facebook'
              target='_blank'
              aria-label='Facebook'
              onClick={(e) => {
                e.preventDefault();
                window.open('https://www.facebook.com/theubcssa');
                }}
            >
              <i class='fab fa-facebook-square' />
            </Link>
            <Link
              class='social-icon-link instagram'
              target='_blank'
              aria-label='Instagram'
              onClick={(e) => {
                e.preventDefault();
                window.open('https://www.instagram.com/theubcssa/');
                }}
            >
              <i class='fab fa-instagram' />
            </Link>
            <Link
              class='social-icon-link linkedin'
              target='_blank'
              aria-label='LinkedIn'
              onClick={(e) => {
                e.preventDefault();
                window.open('https://www.linkedin.com/company/theubcssa/');
                }}
            >
              <i class='fab fa-linkedin' />
            </Link>
            <Link
              class='social-icon-link discord'
              target='_blank'
              aria-label='Discord'
              onClick={(e) => {
                e.preventDefault();
                window.open('https://discord.com/invite/dyPydJK');
                }}
            >
              <i class='fab fa-discord' />
            </Link>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Footer;
